import React, { useState } from "react";

function LoanOfferComparison() {
  // Form input values
  const [firstName, setFirstName] = useState("");
  const [emailAddress, setEmailAddress] = useState("");
  const [loanAmount, setLoanAmount] = useState<number | "">("");
  const [loanTerm, setLoanTerm] = useState<number | "">("");

  // Error messages for each field
  const [errors, setErrors] = useState({
    firstName: "",
    emailAddress: "",
    loanAmount: "",
    loanTerm: "",
  });

  // Validation function for each field
  const validateField = (field: string, value: any) => {
    let errorMessage = "";

    if (field === "firstName") {
      if (!value.trim()) errorMessage = "First name is required.";
    }

    if (field === "emailAddress") {
      if (!value.trim()) errorMessage = "Email is required.";
      else if (!/\S+@\S+\.\S+/.test(value))
        errorMessage = "Enter a valid email.";
    }

    if (field === "loanAmount") {
      if (value === "" || isNaN(value))
        errorMessage = "Loan amount is required.";
      else if (value < 2000) errorMessage = "Must be at least $2,000.";
    }

    if (field === "loanTerm") {
      if (value === "" || isNaN(value)) errorMessage = "Loan term is required.";
      else if (value < 1 || value > 7)
        errorMessage = "Must be between 1 and 7 years.";
    }

    // Update only the error of the current field
    setErrors((prevErrors) => ({
      ...prevErrors,
      [field]: errorMessage,
    }));
  };

  // Handle submit
  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();

    // Check if there are still errors or empty fields
    const hasErrors = Object.values(errors).some((msg) => msg !== "");
    if (hasErrors || !firstName || !emailAddress || !loanAmount || !loanTerm) {
      alert("Please fix the errors before submitting.");
      return;
    }

    // If everything is valid
    console.log({ firstName, emailAddress, loanAmount, loanTerm });
    alert("Form submitted! (Check console for values)");
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        {/* First Name */}
        <input
          type="text"
          placeholder="First Name"
          value={firstName}
          onChange={(e) => {
            setFirstName(e.target.value);
            validateField("firstName", e.target.value);
          }}
          onBlur={() => validateField("firstName", firstName)}
        />
        {errors.firstName && <p style={{ color: "red" }}>{errors.firstName}</p>}
        <br />

        {/* Email */}
        <input
          type="email"
          placeholder="Email Address"
          value={emailAddress}
          onChange={(e) => {
            setEmailAddress(e.target.value);
            validateField("emailAddress", e.target.value);
          }}
          onBlur={() => validateField("emailAddress", emailAddress)}
        />
        {errors.emailAddress && (
          <p style={{ color: "red" }}>{errors.emailAddress}</p>
        )}
        <br />

        {/* Loan Amount */}
        <input
          type="number"
          placeholder="Loan Amount (At least $2000)"
          value={loanAmount}
          onChange={(e) => {
            const val = e.target.value === "" ? "" : Number(e.target.value);
            setLoanAmount(val);
            validateField("loanAmount", val);
          }}
          onBlur={() => validateField("loanAmount", loanAmount)}
          min={2000}
        />
        {errors.loanAmount && (
          <p style={{ color: "red" }}>{errors.loanAmount}</p>
        )}
        <br />

        {/* Loan Term */}
        <input
          type="number"
          placeholder="Loan Term (1-7 Years)"
          value={loanTerm}
          onChange={(e) => {
            const val = e.target.value === "" ? "" : Number(e.target.value);
            setLoanTerm(val);
            validateField("loanTerm", val);
          }}
          onBlur={() => validateField("loanTerm", loanTerm)}
          min={1}
          max={7}
        />
        {errors.loanTerm && <p style={{ color: "red" }}>{errors.loanTerm}</p>}
        <br />

        {/* Submit */}
        <button
          type="submit"
          disabled={
            !firstName ||
            !emailAddress ||
            !loanAmount ||
            !loanTerm ||
            Object.values(errors).some((msg) => msg !== "")
          }
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default LoanOfferComparison;
